import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ProductList from './components/ProductList';
import ProductDetails from './components/ProductDetails'; // Assuming you have this component

function App() {
  return (
    <Router>
      <div className="App">
        <header>
          Product Manager Part 2
        </header>
        <main>
          <Switch>
            <Route exact path="/">
              <ProductList />
            </Route>
            <Route path="/products/:id">
              <ProductDetails />
            </Route>
          </Switch>
        </main>
      </div>
    </Router>
  );
}

export default App;
